// App.js

import React, { useState, useEffect } from 'react';
import { BrowserRouter as Router, Route, Routes, Link } from 'react-router-dom';
import axios from 'axios';

function App() {
  const [tabs, setTabs] = useState([]);

  useEffect(() => {
    axios.get('http://localhost:8000/menu/')
      .then(response => {
        setTabs(response.data.tabs);
      })
      .catch(error => {
        console.error('Error fetching tabs:', error);
      });
  }, []);

  return (
    <Router>
      <div>
        <ul>
          {tabs.map((tab, index) => (
            <li key={index}>
              {tab.sub_tabs ? (
                <div>
                  {tab.name}
                  <ul>
                    {tab.sub_tabs.map((subTab, subIndex) => (
                      <li key={subIndex}>
                        <Link to={`/${tab.name}/${subTab.name}`}>{subTab.name}</Link>
                      </li>
                    ))}
                  </ul>
                </div>
              ) : (
                <Link to={`/${tab.name}`}>{tab.name}</Link>
              )}
            </li>
          ))}
        </ul>
        <Routes>
          <Route path="/Profile" element={Profile} />
          <Route path="/Analysis/Predictive" element={Predictive} />
          <Route path="/Analysis/ImageProcessing" element={ImageProcessing} />
        </Routes>
      </div>
    </Router>
  );
}

function Profile() {
  return <h2>Profile</h2>;
}

function Predictive() {
  return <h2>Predictive Analysis</h2>;
}

function ImageProcessing() {
  return <h2>Image Processing Analysis</h2>;
}

export default App;
